import React ,{Component} from 'react';
import ArticlesList from './articlesList';
import Sidebar from './sidebar';

class Main extends PureComponent {
	
	render() {
		return (
			<div className="row">
				<ArticlesList></ArticlesList>
				<Sidebar></Sidebar>
			</div>
		)
	}

}



export default Main;
